package main

import "fmt"

func trueOrFalse(v1, v2 bool) bool {
	return v1 == true || v2 == true
}

var jumpCache map[int]bool

func didHitJumpCache(index int) bool {
	_, didFind := jumpCache[index]
	return didFind
}

func recursiveJumping(nums []int, index int) bool {

	if didHitJumpCache(index) {
		return jumpCache[index]
	} else if index >= len(nums) {
		return false
	} else if index == len(nums)-1 {
		return true
	} else {
		jumpTarget := nums[index]
		answer := false
		for i := 1; i <= jumpTarget; i++ {
			answer = trueOrFalse(answer, recursiveJumping(nums, index+i))
		}
		jumpCache[index] = answer
		return answer
	}
}

func canJump(nums []int) bool {
	jumpCache = map[int]bool{}
	return recursiveJumping(nums, 0)
}

